import numpy as np

# Harmonic data (amplitude, frequency in Hz, phase in radians)
harmonics = [
    {'A': 0.5, 'f': 50, 'phi': np.radians(30)},
    {'A': 0.8, 'f': 100, 'phi': np.radians(45)},
    {'A': 0.3, 'f': 150, 'phi': np.radians(60)}
]

# Total time period (in seconds)
T = 1.0 / harmonics[0]['f']  # Time for one cycle of the first harmonic

# Initialize total energy
total_energy = 0

# Calculate total energy by integrating each harmonic's energy over the period
for harmonic in harmonics:
    A = harmonic['A']
    omega = 2 * np.pi * harmonic['f']
    phi = harmonic['phi']

    # Calculate energy using the formula: E = 1/2 * A^2
    energy = 0.5 * A**2

    # Add the integrated energy over the period
    total_energy += energy

# Print the total energy
print("Total Energy:", total_energy)

